import './App.css';
import CryptoCurrencyPage from "./pages/CryptoCurrencyPage";
import Navbar from "./components/Navbar";
import {BrowserRouter} from "react-router-dom";

function App() {

  return (
      <>
          <BrowserRouter>
              <Navbar />
          </BrowserRouter>
          <CryptoCurrencyPage />
      </>
  );
}

export default App;
